import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './apiData.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const GetData = () => {
  const [apiData, setApiData] = useState();
  const api = 'https://front-end-test-bvhzjr6b6a-uc.a.run.app';

  useEffect(() => {
    axios.get(api)
      .then(res => {

        if (res)
        // console.log(JSON.stringify(res.data.tampons));

        setApiData(res.data.map((el, i) => {
          return (
            <div className="product-wrapper col-4" key={i}>
              <img className="product-img" src={el.productImage} />
              <p>
                {el.currency}
              </p>
              <p>{el.price}</p>

              <div>
                {el.tampons}
              </div>
            </div>
          );
        }));

      })
  },[]);

  return (
   <div className="container">
    <div className="row">
      {apiData}
    </div>
   </div>
  )
};

export default GetData;
